        // Calculate remaining days in the year after the first 180 days
        int remainingDays = daysInYear - daysFirstPeriod;

        // Calculate total cups needed for the remaining days
        int totalCupsSecondPeriod = remainingDays * cupsPerDaySecondPeriod;

        // Total cups needed in the first year
