        // How many french fries were in the pack when Dave bought it?

        int friesEatenByDave = 14;
        int friesEatenBySeagull = friesEatenByDave / 2;
        int totalEatenByPigeons = 3 * 3; // 3 pigeons, each eating 3 fries
