        // Rearranging gives us:
        // (1/3) * (x - friesAfterPigeons) = 6
        // x - friesAfterPigeons = 18
        // x = 18 + friesAfterPigeons

        int friesInitial = 18 + friesAfterPigeons;
        return friesInitial;
    }

