        // or one lap, around a standard track. One of the two teams is very well-rounded 
        // and each of their members will run their 400 meter leg in precisely 55 seconds. 
        // The other team is less well-rounded; their first runner will run their 400 meter 
        // leg in 60 seconds then each subsequent runner will be 3 seconds faster than the 
        // previous runner. Using this information, how many seconds will the faster team win by?

        int wellRoundedTeamTimePerRunner = 55; // seconds
        int lessWellRoundedFirstRunnerTime = 60; // seconds
        int timeDifference = 3; // seconds faster for each subsequent runner

        // Calculate total time for the well-rounded team
        int wellRoundedTeamTotalTime = wellRoundedTeamTimePerRunner * 4;

        // Calculate total time for the less well-rounded team
        int lessWellRoundedSecondRunnerTime = lessWellRoundedFirstRunnerTime - timeDifference;
        int lessWellRoundedThirdRunnerTime = lessWellRoundedSecondRunnerTime - timeDifference;
        int lessWellRoundedFourthRunnerTime = lessWellRoundedThirdRunnerTime - timeDifference;

        int lessWellRoundedTeamTotalTime = lessWellRoundedFirstRunnerTime + 
                                            lessWellRoundedSecondRunnerTime + 
                                            lessWellRoundedThirdRunnerTime + 
                                            lessWellRoundedFourthRunnerTime;

        // Calculate the difference in time
        int timeDifferenceBetweenTeams = lessWellRoundedTeamTotalTime - wellRoundedTeamTotalTime;

        return timeDifferenceBetweenTeams;
    }

    public static void main(String[] args) {
        System.out.print(solution());
