public class Solution {
    public static int solution() {
        // Q: Brinley is in Mr. Bert's math class. Mr. Bert gives six tests each semester. He allows the students to remove the lowest score from the average each semester. If Brinley has scores of 89, 71, 92, 100 and 86 on the first five tests, what score does she need on the sixth test to get an average of 93?
        int[] scores = {89, 71, 92, 100, 86};
        int testsCount = 6;
        int desiredAverage = 93;

        // Calculate the total score needed for the desired average
        int totalNeeded = desiredAverage * (testsCount - 1); // We remove the lowest score

        // Find the lowest score
        int lowestScore = scores[0];
        for (int score : scores) {
            if (score < lowestScore) {
                lowestScore = score;
            }
        }

        // Calculate the current total score excluding the lowest score
        int currentTotal = 0;
        for (int score : scores) {
            currentTotal += score;
        }
        currentTotal -= lowestScore; // Remove the lowest score

        // Calculate the score needed on the sixth test
        int scoreNeeded = totalNeeded - currentTotal;

        return scoreNeeded;
    }

    public static void main(String[] args) {
        System.out.print(solution());
    }
}
