        // At the second venue, food for each guest is already included in the price. 
        // How many guests are necessary for the two venues to be equal in cost?

        int flatFeeVenue = 200;
        int costPerPersonVenue = 25;
        int foodCostPerPerson = 5;

        // Let x be the number of guests
        // Total cost for the first venue: flatFeeVenue + (foodCostPerPerson * x)
        // Total cost for the second venue: costPerPersonVenue * x

        // We need to find x such that:
        // flatFeeVenue + (foodCostPerPerson * x) = costPerPersonVenue * x

        // Rearranging gives us:
        // flatFeeVenue = (costPerPersonVenue - foodCostPerPerson) * x
        // x = flatFeeVenue / (costPerPersonVenue - foodCostPerPerson)

        int guestsNeeded = flatFeeVenue / (costPerPersonVenue - foodCostPerPerson);
        return guestsNeeded;
    }

