public class Solution {
    public static int solution() {
        // Q: Frederick is making popsicles to sell and to save money he is making his own popsicle sticks. 
        // He can get 200 sticks from a 2 x 4 piece of wood and 400 sticks from a 2 x 8 piece of wood. 
        // He has $24 to buy wood for sticks. A 2 x 4 costs $4. A 2 x 8 costs $6. 
        // What is the most popsicle sticks he can make if he buys the cheapest lumber?

        int budget = 24;
        int cost2x4 = 4;
        int cost2x8 = 6;
        int sticksFrom2x4 = 200;
        int sticksFrom2x8 = 400;

        // Calculate maximum number of 2x4 pieces that can be bought
        int max2x4 = budget / cost2x4;
        // Calculate remaining budget after buying max 2x4 pieces
        int remainingBudgetAfter2x4 = budget % cost2x4;

        // Calculate maximum number of 2x8 pieces that can be bought with remaining budget
        int max2x8WithRemaining = remainingBudgetAfter2x4 / cost2x8;

        // Total sticks if only 2x4 pieces are bought
        int totalSticksWith2x4Only = max2x4 * sticksFrom2x4;

        // Total sticks if max 2x4 pieces are bought and then 2x8 pieces with remaining budget
        int totalSticksWith2x4And2x8 = (max2x4 * sticksFrom2x4) + (max2x8WithRemaining * sticksFrom2x8);

        // Calculate maximum sticks possible
        int maxSticks = Math.max(totalSticksWith2x4Only, totalSticksWith2x4And2x8);

        return maxSticks;
    }

    public static void main(String[] args) {
        System.out.print(solution());
    }
}
