        // Q: A marketing company pays its employees on a commission-based salary system. If you sell goods worth $1000, you earn a 30% commission. Sales over $1000 get you an additional 10% commission. Calculate the amount of money Antonella earned if she sold goods worth $2500.
        double salesAmount = 2500;
        double commissionRate1 = 0.30; // 30% for the first $1000
        double commissionRate2 = 0.10; // additional 10% for sales over $1000
        double commissionEarned = 0;

        if (salesAmount <= 1000) {
            commissionEarned = salesAmount * commissionRate1;
        } else {
            commissionEarned = 1000 * commissionRate1; // commission for the first $1000
            commissionEarned += (salesAmount - 1000) * (commissionRate1 + commissionRate2); // commission for the amount over $1000
        }

        return commissionEarned;
    }

    public static void main(String[] args) {
        System.out.print(solution());
    }
}
