        // Q: There is one set of twins and one set of triplets. One twin is 7 years older than one triplet. If their combined ages are 44, how old is one of the twins?
        int combinedAges = 44;
        int ageDifference = 7;
        // Let the age of the triplet be x, then the age of the twin is x + 7
        // Therefore, x + (x + 7) = 44
        // 2x + 7 = 44
        // 2x = 44 - 7
        // 2x = 37
        // x = 37 / 2
        int tripletAge = (combinedAges - ageDifference) / 2;
        int twinAge = tripletAge + ageDifference;
