public class Solution {
    public static int solution() {
        // Q: Last month, Tasha made $80 from selling lemonade and mowing lawns. The first week, she mowed Kamala's lawn thrice as many times as she did Joe's. The following week, she mowed Alba's lawn five times as she did Joe's. If Joe paid Tasha $6 for her work, how much did she make from lemonade sales?
        int totalEarnings = 80;
        int joePayment = 6;

        // Let x be the number of times Tasha mowed Joe's lawn
        // Then, she mowed Kamala's lawn 3x times and Alba's lawn 5x times
        // Total earnings from mowing = (x * 6) + (3x * 6) + (5x * 6) = 14x * 6
        // Total earnings from mowing = 84x

        // We need to find x such that 84x + lemonadeEarnings = 80
        // lemonadeEarnings = 80 - 84x

        // Since we don't know x, we can assume she mowed Joe's lawn once (x = 1)
        int x = 1;
        int totalMowingEarnings = 84 * x; // 84 * 1 = 84
