        x = 0;
        totalMowingEarnings = 84 * x; // 84 * 0 = 0
        lemonadeEarnings = totalEarnings - totalMowingEarnings; // 80 - 0 = 80

        // Therefore, she made $80 from lemonade sales
        int result = lemonadeEarnings;

        return result;
    }

