public class Solution {
    public static int solution() {
        // Q: Calvin is making soup for his family for dinner. He has a pot with enough soup to fill four adult's bowls or eight child's bowls. He is an adult and will be eating with his adult wife and their two children. If everyone eats one bowl at a meal, how many times will each child be able to have a bowl of soup for lunch from the leftover soup?
        int adultBowls = 4;
        int childBowls = 8;
        int totalPeople = 2 + 2; // 2 adults and 2 children
        int bowlsConsumed = totalPeople; // each person eats one bowl
        int bowlsLeft = adultBowls; // total bowls available for adults

        // Calculate how many bowls are left after the adults eat
        bowlsLeft -= bowlsConsumed; // subtract the bowls consumed by adults

        // Each child's bowl is equivalent to half an adult's bowl
        int childBowlsFromLeftover = bowlsLeft * 2; // since 1 adult bowl = 2 child bowls

        // Each child can have the same number of bowls from the leftover soup
        int bowlsPerChild = childBowlsFromLeftover / 2; // divide by 2 for the two children

        return bowlsPerChild;
    }

    public static void main(String[] args) {
        System.out.print(solution());
    }
}
