        double timeSwum = distanceSwum / swimSpeed;

        // Resting time is half of the swimming time
        double restTime = timeSwum / 2.0;

        // Speed for the remaining distance is half the original speed
        double remainingSpeed = swimSpeed / 2.0;

        // Time taken to swim the remaining distance
        double timeRemaining = distanceRemaining / remainingSpeed;

        // Total time taken
        double totalTime = timeSwum + restTime + timeRemaining;

        return totalTime;
