        // Q: A tank has a capacity of 18000 gallons. Wanda and Ms. B decided to pump water from a pond to fill the tank in two days. 
        // On the first day, working in shifts, Wanda filled 1/4 of the tank's capacity with water, 
        // and Ms. B pumped 3/4 as much water as Wanda pumped into the tank that day. 
        // On the second day, Wanda pumped 2/3 of the amount of water she pumped on the previous day, 
        // while Ms. B only pumped 1/3 of the number of gallons she pumped on the first day. 
        // How many gallons of water are remaining for the tank to be full?

        int tankCapacity = 18000;
        double wandaDay1 = tankCapacity * 1.0 / 4; // Wanda pumps 1/4 of the tank
        double msBDay1 = wandaDay1 * 3.0 / 4; // Ms. B pumps 3/4 of what Wanda pumped

        double totalDay1 = wandaDay1 + msBDay1; // Total water pumped on day 1

        double wandaDay2 = wandaDay1 * 2.0 / 3; // Wanda pumps 2/3 of her first day amount
        double msBDay2 = wandaDay1 * 3.0 / 4 * 1.0 / 3; // Ms. B pumps 1/3 of her first day amount

        double totalDay2 = wandaDay2 + msBDay2; // Total water pumped on day 2

        double totalPumped = totalDay1 + totalDay2; // Total water pumped in two days
        double waterRemaining = tankCapacity - totalPumped; // Water remaining to fill the tank

        int result = (int) waterRemaining; // Cast to int for final result
        return result;
    }

    public static void main(String[] args) {
        System.out.print(solution());
    }
}
