        // Q: Marcus is trying to decide whether he really needs to do his homework. 
        // There's a 50% chance that tomorrow he'll have a substitute teacher who won't collect the homework. 
        // Even if the normal teacher comes in, there's a 40% chance she'll give everyone an extension. 
        // Even if the whole class doesn't get an extension, there's a 20% chance Marcus can convince the teacher 
        // his dog ate his assignment and get a personal extension. 
        // What is the percentage chance that Marcus will actually have to turn in his homework tomorrow?

        double chanceSubstitute = 0.5; // 50% chance of substitute
        double chanceExtensionNormal = 0.4; // 40% chance of extension with normal teacher
        double chancePersonalExtension = 0.2; // 20% chance of personal extension

        // Probability that he has to turn in homework if normal teacher comes
        double chanceNoExtensionNormal = 1 - chanceExtensionNormal; // 60% chance of no extension
        double chanceNoPersonalExtension = 1 - chancePersonalExtension; // 80% chance of no personal extension

        // Total chance he has to turn in homework
        double chanceTurnInHomework = (1 - chanceSubstitute) * chanceNoExtensionNormal * chanceNoPersonalExtension;

        // Convert to percentage
        int percentageChance = (int) (chanceTurnInHomework * 100);

        // Add the chance of substitute teacher (who won't collect homework)
        percentageChance += (int) (chanceSubstitute * 100);

        return percentageChance;
    }

    public static void main(String[] args) {
        System.out.print(solution());
    }
}
