        // Likelihood that Ellen's friend gets sprayed with soda from a shaken can
        double likelihood = (double) shakenSodas / remainingSodas * 100; // (2 / 8) * 100

        // Since the result should be an integer percentage
        int result = (int) likelihood;

        return result;
    }

