public class Solution {
    public static int solution() {
        // Q: Donny can only drink water if it's at least 40 degrees. He has two mugs of water. One mug is 33 degrees. The other is an unknown temperature. If he pours 4 ounces of water from the 33-degree mug into his water bottle and one ounce from the other bottle, he is now able to drink the water. At least how many degrees is the second bottle?
        int tempMug1 = 33; // temperature of the first mug
        int tempMug2 = 0; // unknown temperature of the second mug
        int ouncesMug1 = 4; // ounces poured from the first mug
        int ouncesMug2 = 1; // ounces poured from the second mug
        int totalOunces = ouncesMug1 + ouncesMug2; // total ounces in the water bottle

        // The final temperature must be at least 40 degrees
        // Using the formula for the weighted average temperature:
        // (tempMug1 * ouncesMug1 + tempMug2 * ouncesMug2) / totalOunces >= 40
        // Rearranging gives us:
        // tempMug1 * ouncesMug1 + tempMug2 * ouncesMug2 >= 40 * totalOunces
        // tempMug2 * ouncesMug2 >= 40 * totalOunces - tempMug1 * ouncesMug1
        // tempMug2 >= (40 * totalOunces - tempMug1 * ouncesMug1) / ouncesMug2

        int requiredTempMug2 = (40 * totalOunces - tempMug1 * ouncesMug1) / ouncesMug2;

        // Since temperature must be a whole number, we need to round up if necessary
        if ((40 * totalOunces - tempMug1 * ouncesMug1) % ouncesMug2 != 0) {
            requiredTempMug2++;
        }

        return requiredTempMug2;
    }

    public static void main(String[] args) {
        System.out.print(solution());
    }
}
