        // Q: A teacher uses a 5-inch piece of chalk to write math equations on a chalkboard for his students. 
        // The teacher likes to conserve chalk, so he tries to only use 20% of the chalk each day. 
        // Since the teacher cannot write with a very small piece of chalk, he recycles the chalk when it is smaller than 2 inches. 
        // On Monday the teacher used a new piece of chalk. His students need extra help that day, 
        // so he ended up writing more than usual. He used up 45% of the chalk by the end of the day. 
        // If the teacher goes back to using only 20% of the chalk each day, how many days does he have before he has to recycle this piece?

        double chalkInitial = 5.0; // initial length of chalk in inches
        double chalkUsedMonday = chalkInitial * 0.45; // chalk used on Monday
        double chalkRemaining = chalkInitial - chalkUsedMonday; // remaining chalk after Monday

        double dailyUsage = chalkInitial * 0.20; // daily usage of chalk
        int daysBeforeRecycle = 0; // counter for days before recycling

        // Calculate how many days he can use the remaining chalk before it goes below 2 inches
        while (chalkRemaining >= 2.0) {
            chalkRemaining -= dailyUsage; // reduce the remaining chalk by daily usage
            daysBeforeRecycle++; // increment the day counter
        }

        int result = daysBeforeRecycle; // final result is the number of days before recycling
        return result;
    }

    public static void main(String[] args) {
        System.out.print(solution());
    }
}
