        int snowballsTarget = 60;
        int snowballsBuiltPerHour = 20;
        int snowballsMeltedPer15Minutes = 2;

        // Calculate the number of snowballs that melt in an hour
        int minutesInAnHour = 60;
        int meltInterval = 15;
        int meltCountPerHour = (minutesInAnHour / meltInterval) * snowballsMeltedPer15Minutes;

        // Effective snowballs built in an hour
        int effectiveSnowballsPerHour = snowballsBuiltPerHour - meltCountPerHour;

        // Calculate the time required to reach the target snowballs
        int hoursNeeded = 0;
        int currentSnowballs = 0;

        while (currentSnowballs < snowballsTarget) {
            currentSnowballs += effectiveSnowballsPerHour;
            hoursNeeded++;
        }

        // Convert hours to minutes
        int result = hoursNeeded * 60;

        return result;
    }

    public static void main(String[] args) {
        System.out.print(solution());
    }
}
