        // Q: Tim enters a competition and has to try and guess the number of red jelly beans in a jar. 
        // The jar has a square base and is 6 inches by 6 inches and 15 inches tall. 
        // He knows that a jelly bean is .15 cubic inches. 
        // He also knows that they get about 80% efficiency in packing. 
        // He estimates 30% of the jelly beans are red. 
        // The true number of red jelly beans in the container is 900. 
        // How far off was his guess?

        int jarBaseLength = 6; // inches
        int jarBaseWidth = 6; // inches
        int jarHeight = 15; // inches
        double jellyBeanVolume = 0.15; // cubic inches
        double packingEfficiency = 0.8; // 80%
        double redJellyBeanPercentage = 0.3; // 30%
        int trueRedJellyBeans = 900; // true number of red jelly beans

        // Calculate the volume of the jar
        int jarVolume = jarBaseLength * jarBaseWidth * jarHeight; // cubic inches

        // Calculate the effective volume for jelly beans
        double effectiveVolume = jarVolume * packingEfficiency; // cubic inches

        // Calculate the total number of jelly beans that can fit in the jar
        int totalJellyBeans = (int)(effectiveVolume / jellyBeanVolume);

        // Estimate the number of red jelly beans
        int estimatedRedJellyBeans = (int)(totalJellyBeans * redJellyBeanPercentage);

        // Calculate how far off his guess was
        int difference = Math.abs(estimatedRedJellyBeans - trueRedJellyBeans);

        return difference;
    }

