        // How many weeks does it take him to fill in all the holes?

        int holesDugPerDay = 6;
        int daysOnVacation = 14;
        int totalHolesDug = holesDugPerDay * daysOnVacation;

        int holesFilledPerDay = 9;
        int netHolesPerDay = holesFilledPerDay - holesDugPerDay; // holes filled minus holes dug

        // Calculate the number of days needed to fill all holes
        int daysToFillHoles = totalHolesDug / netHolesPerDay;

        // If there are remaining holes, we need an additional day
        if (totalHolesDug % netHolesPerDay != 0) {
            daysToFillHoles++;
        }

        // Convert days to weeks
        int weeksToFillHoles = daysToFillHoles / 7;

        // If there are remaining days, we need an additional week
        if (daysToFillHoles % 7 != 0) {
            weeksToFillHoles++;
        }

        int result = weeksToFillHoles;
        return result;
